import React from 'react';

function About() {
    return (
        <div className="max-w-4xl mx-auto py-20">
            <h1 className="text-3xl font-bold">About Us</h1>
            <p className="mt-4 text-gray-700">
                At Humming Bird Consulting, We Specialize In Empowering Startups By Providing Engineering Expertise,
                Strategic Insights, and Expert advice to achieve your business goals.
            </p>
        </div>
    );
}

export default About;
